import React from 'react';
import axios from 'axios';
import './App.css';

class App extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`tcp://127.0.0.1:9393`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    )
  }
}

export default App;
